import React from "react";
import { Grid, Header, Segment, Divider, List, Icon } from "semantic-ui-react";

class Contact extends React.Component {
  render() {
    return (
      <Grid centered columns={2} stackable style={{ marginTop: "20vh" }}>
        <Grid.Column>
          <Header as="h2" textAlign="center">
            Fill Out The Form Below:
          </Header>
          <Segment>
            <Divider section />
            <List center size={"big"}>
              <List.Item href="">
                <List.Icon name="facebook" />
                <List.Content>Facebook</List.Content>
              </List.Item>
              <List.Item>
                <List.Icon name="instagram" />
                <List.Content>Instagram</List.Content>
              </List.Item>
              <List.Item>
                <List.Icon name="twitter" />
                <List.Content>Twitter</List.Content>
              </List.Item>
            </List>
          </Segment>
        </Grid.Column>
      </Grid>
    );
  }
}

export default Contact;
